import React from 'react';
import { Routes, Route } from 'react-router-dom';
import './App.css'; // Import global styles

// Import components and pages from their subfolders
import Navbar from './components/Navbar';
import HomePage from './pages/HomePage';
import ProviderListPage from './pages/ProviderListPage';
import ProviderProfilePage from './pages/ProviderProfilePage';

// --- ADD THESE TWO NEW IMPORTS ---
import LoginPage from './pages/LoginPage';
import ProviderRegisterPage from './pages/ProviderRegisterPage';


function App() {
  return (
    <div className="App">
      {/* Navbar will show on every page */}
      <Navbar />

      {/* Main content area where pages will be swapped */}
      <main>
        <Routes>
          {/* Your existing routes */}
          <Route path="/" element={<HomePage />} />
          <Route path="/providers" element={<ProviderListPage />} />
          <Route path="/providers/:id" element={<ProviderProfilePage />} />

          {/* --- ADD THESE TWO NEW ROUTES --- */}
          <Route path="/login" element={<LoginPage />} />
          <Route path="/provider-login" element={<ProviderRegisterPage />} />
        </Routes>
      </main>
    </div>
  );
}

export default App;
